import { useState } from "react";
import { withStyles, makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import styled from "styled-components";
import theme from "../Assets/theme";
import { Card } from "./defaultComponents";

const StyledTableCell = withStyles(() => ({
  head: {
    backgroundColor: theme.Grey1,
    color: "black",
  },
  body: {
    fontSize: 14,
  },
}))(TableCell);

const StyledTableRow = withStyles(() => ({
  root: {
    "&:nth-of-type(odd)": {
      backgroundColor: theme.mainGrey,
    },
  },
}))(TableRow);

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

function TestsTable() {
  const classes = useStyles();
  return (
    <Wrapper>
      {/* <Card> */}
      <TableContainer component={Card} className="tableContainer">
        <Table className={classes.table} aria-label="simple table"></Table>
        <TableHead>
          <TableRow>
            <StyledTableCell>Ceva</StyledTableCell>
            <StyledTableCell>Altceva</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          <StyledTableRow>
            <StyledTableCell>Ceva</StyledTableCell>
            <StyledTableCell>Altceva</StyledTableCell>
          </StyledTableRow>
          <StyledTableRow>
            <StyledTableCell>Ceva</StyledTableCell>
            <StyledTableCell>Altceva</StyledTableCell>
          </StyledTableRow>
        </TableBody>
      </TableContainer>
      {/* </Card> */}
    </Wrapper>
  );
}

const Wrapper = styled.div`
  //   width: 100%;
  //   height: 100%;
  .tableContainer {
    max-width: 50vw;
  }

  .${useStyles.table} {
    width: 100%;
  }
  display: flex;
  align-items: center;
  justify-content: center;
  margin-left: 30vw;
  margin-top: 20vh;
`;

export default TestsTable;
